import axios from 'axios';

function sendDelete(userId){
    
    const baseUrl = `http://localhost:4000/orders/delete/`+userId   
     
    axios.get(baseUrl)
    .then(response =>{
      if (response.data.success) {
        alert(response.data.message)
      }
    })
    .catch ( error => {
      alert("Error on delete item")
    })
  }
  export default sendDelete
  module.exports = {
    sendDelete
  }
